import React, { useEffect } from 'react';

const styles = {
  border: '1px solid black',
  margin: '12px',
  textAlign: 'center'
};

const ListItem = ({ item }) => {
  useEffect(() => {
    console.log(item);
  }, []);

  return (
    <div style={styles}>
      <h5>{item.name}</h5>
      <h6>{item.distance / 1000} kms</h6>
    </div>
  );
};

export default ListItem;
